import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<${scopeTag("ui5-li-custom", tags, suffix)} id="${ifDefined(context._id)}" data-ui5-stable="${ifDefined(context.stableDomRef)}" role="separator" class="${classMap(context.classes)}" disabled></${scopeTag("ui5-li-custom", tags, suffix)}>`;


export default block0;
